import React from "react";

function Login() {
    return (
        <div className="container">
            <h1>Add New Book</h1>

            <form >
                <input
                    onChange={handleChange}
                    name="email"
                    placeholder="Email"
                    value={user.passwo}
                />
                <input
                    onChange={handleChange}
                    name="password"
                    placeholder="Password"
                    value={user.password}
                />
                <button type="submit"> Submit</button>
            </form>
        </div>
    );
}

export default Login;
